<!DOCTYPE html>
<html lang="en">
  <head>
    <meta charset="utf-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0"></meta>
    <script type="text/javascript" src="site.js"></script>
  </head>

  <body>
    <!-- Top header/nav bar -->
    <div id="overlord-header">
    </div>
    
    <div class="container error-page" data-field="error-page">
      <div class="row">
        <div class="col-md-3">
          <div class="error-icon error-409 pull-right"></div>
        </div>
        <div class="col-md-8">
          <div class="title" data-i18n-key="title">Already Exists</div>
          <div class="description" data-i18n-key="description">
            You've just tried to create something that already exists!  Maybe 
            try again with a different name...
          </div>
          <div style="margin-top: 20px">
            <a href="javascript:window.history.back()" class="btn btn-default btn-cancel" data-i18n-key="go-back">OK, Go Back</a>
          </div>
        </div>
      </div>
    </div>
  </body>
</html>
